import {  StyleSheet, Text, View } from 'react-native';


const styles = StyleSheet.create({
    container: {
      flex: 8,
      backgroundColor: '#cdcdcd',
    },
    containerBottom: {
      flex: 8,
      backgroundColor: '#cdcdcd',
      justifyContent: 'center',
      alignItems: 'center',
      margin: 'auto',
    },
    content: {
      flex: 1,
      width: 100,
      height: 40,
      backgroundColor: 'red',
      padding: 10,
      borderRadius: 12,
      justifyContent: 'center',
      alignItems: 'center',
      margin: 'auto',
      marginBottom: 300,
    },
    button: {
      width: 100,
      height: 40,
      padding: 10,
      textAlign: 'center',
      
    },
  });
